function getStyle(feature, resolution)
{
    if(feature.get('differencetwo') == 1)
		color = "#00FF00";
	if(feature.get('differencetwo') == 2)
		color = "#0000FF";
	if(feature.get('differencetwo') == 3)
		color = "#FFA500";
	if(feature.get('differencetwo') == 4)
		color = "#FF0000";
	
	return new ol.style.Style({
		image: new ol.style.Circle({
			radius: 3,
			fill: new ol.style.Fill({
				color: color
			})
		})
	});
}

